INSERT INTO `CDHSCriterion` VALUES ('05d7669ba496488ba7f0e6dbb6266be2','Storage Access','INTEROPERABILITY_STORAGE_ACCESS','How is the data of the cloud data store accessed?','MULTIPLE',3,'7d04199ea39041c0a3538864fcd92e15'),('0629f4ed0aee464db0118c38263ca293','Backup Method','BACKUP_METHOD','What backup methods are supported by the provider of the cloud data store?','MULTIPLE',4,'f77f2bd877da4c1a9351fad06257b129'),('0be224e6c57e4d3ea947cfd0b8767c4c','Accessability','STORAGE_ACCESSABILITY','Is it possible to restrict access to the cloud data store to a Virtual Private Network (VPN)?','SINGLE',1,'2a6fd7a6d71e41ff8d8e54f418e0ce5a'),('0d3da195c7ff495cb63071b10f5999ef','Choice','LOCATION_CHOICE','Is it possible to select the location where the data is stored?','SINGLE',1,'888f26469277424b87bf29fe2b4e0a16'),('132db49a4cd747109b038bef98f2b811','ORM','INTEROPERABILITY_ORM','Which Object Relational Mappers (ORMs) are supported by the provider or community?','MULTIPLE',4,'7d04199ea39041c0a3538864fcd92e15'),('15767383a8574a69806be60640e20d9a','Max Domain (NoSQL) / Table (RDBMS) / Bucket (BLOB) Size','DATA_CONSTRAINTS_DOMAIN_SIZE','Are there any restrictions concerning the max. size of domains, tables or buckets/folders that can be stored?','SINGLE',2,'cf265ea08a794fbeb8ac9dd9d7f8b960'),('16cd19f4ee004ef28779284ccc833668','Schema Customizable','FLEXABILITY_SCHEMA_CUSTOMIZABLE','In case there is a schema, is the schema customizable?','SINGLE',2,'c906192a2dc948738c2c661026fff3ec'),('19e171736518456c87199c1b6b8cb7a1','Transfer Encryption','SECURITY_TRANSFER_ENCRYPTION','Is the data transfer to and from the cloud data store encrypted?','SINGLE',2,'1b38031d4be543e6b9f1c3c7064fd86e'),('1e3655a562f143af8a5a805146a4d998','Storage Encryption','SECURITY_STORAGE_ENCRYPTION','Is the data inside the cloud data store stored encrypted?','SINGLE',1,'1b38031d4be543e6b9f1c3c7064fd86e'),('1fa1ede903434557b0238d32a45d7d83','Service Model','CLOUD_COMPUTING_SERVICE_MODEL','Which cloud service model does the cloud data store use? IaaS stands for Infrastructure as a Service, PaaS for Platform as a Service and SaaS for Software as a Service.','SINGLE',1,'bd789672517448adac99bdfb46ff8d6a'),('203b9d84c80142ffa194dd8bfbb356dc','Replication','AVAILABILITY_REPLICATION','Does the cloud data store run on a replicated infrastructure, e.g. to be highly available?','SINGLE',1,'d8df252de1a7418796036f435cff0f5d'),('25aa3a4a92504794831d316f1617d509','Availability in case of Partitioning','CAP_AVAILABILITY_IN_CASE_OF_PARTITIONING','Is the cloud data store available in case of a network outage (partitioning)?','MULTIPLE',2,'d0a4c6c1b2e64a83bd27909cf25f655a'),('2b0d0cb04c304147b0231b681844395d','Predictability Read/Write/Response','PERFORMANCE_PREDICTABILITY','Is the response time for read and write requests predictable?','SINGLE',1,'fb6c52d9628a499c923c4a957a9d1a26'),('31d1151cdf3a497e9fd4af3220926992','Number of Backups Kept','BACKUP_NUMBERS_KEPT','How many backups are kept by the provider of the cloud data store?','MULTIPLE',3,'f77f2bd877da4c1a9351fad06257b129'),('34e33e2aa1ac48e0a986f865345ee7a7','Geographic location','LOCATION_GEOGRAPHY','Where can the data be stored?','SINGLE',2,'888f26469277424b87bf29fe2b4e0a16'),('433fca4556b44380802c92a49bd84080','Data Portability','INTEROPERABILITY_DATA_PORTABILITY','Does the cloud data store allow to im- and/or export data? Is one- and/or two-way synchronisation with a local data store possible?','MULTIPLE',1,'7d04199ea39041c0a3538864fcd92e15'),('4c3cbaff88be493f83f2bad49a4a0186','Consistency Model','CAP_CONSISTENCY_MODEL','What consistency models are supported by the cloud data store?','MULTIPLE',1,'d0a4c6c1b2e64a83bd27909cf25f655a'),('4e6c61393c644fab950aab2427a78ed3','Time to Launch new Instance','SCALABILITY_TIME_TO_LAUNCH','How long does it take to launch an additional instance or node in case of scale out?','SINGLE',4,'97d3376a010c4e35a6c41f4e11f288b0'),('4f86e041158d45e9ae796873002adfb7','Authorization','SECURITY_AUTHORIZATION','Is it possible to to configure who can do what, e.g. accessing or manipulating which data. Can be done by configuration through permissions for instance.','SINGLE',7,'1b38031d4be543e6b9f1c3c7064fd86e'),('524dc181b2394434b16c02a93608290c','Automated Scalability Criterion','SCALABILITY_CRITERION','What is the specified scalability criterion to scale up and down?','MULTIPLE',5,'97d3376a010c4e35a6c41f4e11f288b0'),('58fc6100d2664d82b469668f333bbd62','Replication Location','AVAILABILITY_REPLICATION_LOCATION','Where are the replicas located?','MULTIPLE',4,'d8df252de1a7418796036f435cff0f5d'),('5a249ab25af9472191a814de5b6e70cb','Product including Version','COMPATABILITY_PRODUCT_AND_VERSION','Which standard product is used by the cloud data store in the background?','MULTIPLE',1,'6e1b84598995410b950bede10fdb0729'),('6380c010834a46418089a971aa83a668','Instance Size Predefined','DATA_CONSTRAINTS_INSTANTE_SIZE_PREDEFINED','Is the size of the instance of the cloud data store predefined or does it automatically adapt with the usage?','SINGLE',5,'cf265ea08a794fbeb8ac9dd9d7f8b960'),('750a033f224246d194bd64137aa850c6','Interrupt of Access','BACKUP_INTERRUPT_OF_ACCESS','Does the creation of a backup shortly interrupt access to the cloud data store?','SINGLE',2,'f77f2bd877da4c1a9351fad06257b129'),('753c9b7a32bd43d9ba176f0ea8438902','Transfer Limit','SCALABILITY_TRANSFER_LIMIT','Is there a limit of how much data can be transfered to and from the cloud data store per day?','SINGLE',6,'97d3376a010c4e35a6c41f4e11f288b0'),('76cc72b7d4b54c209e7a5a5f3deacc19','Supported Integrated Developement Environment (IDE)','INTEROPERABILITY_IDE','Which Integrated Development Environements (IDEs) are supported by the provider or community?','MULTIPLE',6,'7d04199ea39041c0a3538864fcd92e15'),('831e07703f51453b905007f0b11213b3','Authentication','SECURITY_AUTHENTICATION','Is it possible to setup users with access rights to the cloud data store?','SINGLE',4,'1b38031d4be543e6b9f1c3c7064fd86e'),('840c6b9e81b54c22b9b5ed9d59923fd8','Migration & Deployment Support','INTEROPERABILITY_MIGRATION_AND_DEPLOYMENT_SUPPORT','Does the provider give support for data migration and setup?','SINGLE',5,'7d04199ea39041c0a3538864fcd92e15'),('8e0dbb23311840c68d033665ed57aec4','Developer SDKs','INTEROPERABILITY_SDK','Which developer SDKs are provided by the cloud data store provider?','MULTIPLE',7,'7d04199ea39041c0a3538864fcd92e15'),('8efb3276cd8149bd8c5c0ef43460d15e','Replication Method','AVAILABILITY_REPLICATION_METHOD','How is the replication done?','MULTIPLE',3,'d8df252de1a7418796036f435cff0f5d'),('8fc3c4f5ff70448bbf3277ae12cff8f9','Multi-tenancy Capability','MULTI_TENANCY_SUPPORT','Does the cloud data store provide functionalities for multi-tenant applications?','SINGLE',1,'244e16c145294c348c1e480e3d78f9f4'),('90e99c1e1a4d47b3bd45abc1b993219d','Firewall','SECURITY_FIREWALL','Is it possible to restrict access to the cloud data store by custom firewall settings?','SINGLE',3,'1b38031d4be543e6b9f1c3c7064fd86e'),('93cd078658d946faa3cd24eb9808044c','Storage Type','STORAGE_TYPE','What kind of storage does the cloud data store belong to? RDBMS stands for Relational Database Management System, NoSQL stands for Not only SQL, Blob Store is for storing binary data and CDN stands for Content Delivery Network.','SINGLE',2,'2a6fd7a6d71e41ff8d8e54f418e0ce5a'),('9893bfd6377e4a5ab5c1cba1f9bfe050','Data Exchange Format','INTEROPERABILITY_DATA_EXCHANGE_FORMAT','In which format can the data be exchanged with the cloud data store?','MULTIPLE',2,'7d04199ea39041c0a3538864fcd92e15'),('9c14b41c82cc4f74bbbd54e49e675948','Transaction Support','STORAGE_TRANSACTION_SUPPORT','Is the cloud data store ACID compliant?','SINGLE',3,'2a6fd7a6d71e41ff8d8e54f418e0ce5a'),('b2cf6ee6d7434babb9aeaec0025b6599','Degree of Automation','MANAGEMENT_AND_MAINTENANCE_EFFORT_DEGREE_OF_AUTOMATION','How are updates of the cloud data store managed? Are they installed automatically or is it a manual process (self-service)?','MULTIPLE',1,'4e57e820d7724e15bda701e589a48a2f'),('bf916be1d568479f8c6bd0ae0704cb61','Throughput','PERFORMANCE_THROUGHPUT_LIMIT','What is the maximum throughput for reading and writing data?','SINGLE',3,'fb6c52d9628a499c923c4a957a9d1a26'),('c150e13fa2aa41828d9fb7ee66790106','Max Item (NoSQL) / Row (RDBMS) / File (BLOB) Size','DATA_CONSTRAINTS_ITEM_SIZE','Are there any restrictions concerning the max. size of objects, rows or files that can be stored?','SINGLE',1,'cf265ea08a794fbeb8ac9dd9d7f8b960'),('c45f80d7574945eeb744ec9a0fce83c5','Max Item/Row/File Number Per Instance','DATA_CONSTRAINTS_ITEM_NUMBER','Are there any restrictions concerning the max. number of objects, rows or files that can be stored?','SINGLE',3,'cf265ea08a794fbeb8ac9dd9d7f8b960'),('c9d8bd1c1d7d4a38b1382fd39b43ad31','Degree of Automation','SCALABILITY_DEGREE_OF_AUTOMATION','Does the cloud data store scale up and down automatically based on the usage, is scaling a manuell process or does it only scale automatically to a certain degree and then manual work is required?','SINGLE',1,'97d3376a010c4e35a6c41f4e11f288b0'),('cc4392bf333347a3ae9243645241c66e','Max Size Per Instance (All Domains, All Tables, All Buckets)','DATA_CONSTRAINTS_INSTANCE_SIZE','Are there any restrictions concerning the max. size per instance of the cloud data store (incl. space for indexes, views, etc.)?','SINGLE',4,'cf265ea08a794fbeb8ac9dd9d7f8b960'),('d03cac7743ff44a598c4a0c5772f3ac8','Confidentiality','SECURITY_CONFIDENTIALITY','Can the provider or any third party inspect the actual data?','SINGLE',5,'1b38031d4be543e6b9f1c3c7064fd86e'),('d1264caee2fd482589f1ee5c33481e36','Deployment Model','CLOUD_COMPUTING_DEPLOYMENT_MODEL','Which cloud deployment models does the cloud data store provide?','MULTIPLE',2,'bd789672517448adac99bdfb46ff8d6a'),('d3b1d7a36e13434188017e63ad4d3a90','Cloud Location','LOCATION_CLOUD','Is the cloud data store hosted off-premise or is it e.g. also availble as an appliance that can be hosted on-premise?','MULTIPLE',3,'888f26469277424b87bf29fe2b4e0a16'),('d6466d6dddbf499dad2492353964385a','Schema','FLEXABILITY_SCHEMA_SUPPORT','Is it possible to create a schema for the data?','SINGLE',1,'c906192a2dc948738c2c661026fff3ec'),('d66f09daaa004fa6b37514575973fdb8','Degree','AVAILABILITY_DEGREE','What is the guaranteed availability by the provider for the cloud data store itself?','SINGLE',6,'d8df252de1a7418796036f435cff0f5d'),('d6a0185c6cd44aeebc686a7ce29585dc','Degree','SCALABILITY_DEGREE','Are there any known limits how big the cloud data store can scale up to (e.g. memory, storage, nodes)?','SINGLE',3,'97d3376a010c4e35a6c41f4e11f288b0'),('dba6f34e727a4a2292a5518b5de3d8e9','Automatic Failover','AVAILABILITY_AUTOMATIC_FAILOVER','Is the master node automatically switched in case of a problem with the current master node?','SINGLE',5,'d8df252de1a7418796036f435cff0f5d'),('e1784b79bf634c82b594a86ee780d02e','Multi-tenancy Type','MULTI_TENANCY_TYPE','If multi-tenancy features are provided, which types of multi-tenancy are supported?','MULTIPLE',2,'244e16c145294c348c1e480e3d78f9f4'),('eb93b4e3ff7d4c3097cdbb64a95e3def','Supported KPIs','MONITORING_KPIS','Which Key Performance Indicators (KPIs) are provided to monitor the cloud data store instances?','MULTIPLE',1,'1e8610f35455463397d8bd79e225be18'),('ef5ab46bd349408d85972f68ff560110','Replication Type','AVAILABILITY_REPLICATION_TYPE','What replication type is used to be highly available?','MULTIPLE',2,'d8df252de1a7418796036f435cff0f5d'),('f093b7b9fcdd4fac841758746a653b13','Latency','PERFORMANCE_LATENCY','What is the average internal latency for simple read request?','SINGLE',4,'fb6c52d9628a499c923c4a957a9d1a26'),('f53a4ff1c0ad47ccaaf129a9d010ece3','Type','SCALABILITY_TYPE','Does the the cloud data store scale by adding better hardwarde (scale up) or by running on more instances (scale out) or a mix of both?','SINGLE',2,'97d3376a010c4e35a6c41f4e11f288b0'),('fa3663bf6c944e9db8bb2d50dfe67e4a','Integrity','SECURITY_INTEGRITY','Is the data stored in the cloud data store protected from manipulation?','SINGLE',6,'1b38031d4be543e6b9f1c3c7064fd86e'),('fdca854074a64d99930eb1fc0d78bd80','Backup Interval','BACKUP_INTERVAL','Are backups provided? If yes, how often can they be triggered?','MULTIPLE',1,'f77f2bd877da4c1a9351fad06257b129');
