INSERT INTO `CDMScenario` VALUES ('08e7fbf313614786a60dd3cc34987e33','Off-Loading of Peak Loads (Cloud Burst)','Off-loading of peak loads means moving data temporarily to the Cloud to deal with high traffic situations. After the peak is over (e.g. Christmas sale) and the local data center ressources are big enough to handle the traffic, the data is moved back. Usually the whole application is moved to the Cloud in a peak load situation and moved back afterwards.','/img/cloud-burst.png',5,'2012-07-10 21:39:36'),('245af91045854d2c8537d5e88626b700','Archive','Similar to backups, creating a copy of parts or of the whole data base layer. Reasons for archiving can be regulatory rules or relief of the production system in case the archived data is also removed from production system.','/img/archive.png',9,'2012-07-10 21:39:36'),('2c3481bc8ee64ef3b9bf8b570799b633','Backup','Creating a plain copy of the data base layer and store it in the Cloud to capture the data of a certain point in time. Backups can be used for recovering crashed or manipulated systems.','/img/backup.png',8,'2012-07-10 21:39:36'),('38793cd441e2416ba6981e815979036a','Plain Outsourcing','Plain outsourcing of the DBL means migrating the local DBL to the Cloud without changing the type of the datastore (RDBMS, NoSQL or Blob Store), usually the whole application is migrated as well and data migration is part of the overall Cloud migration.','/img/outsourcing.png',1,'2012-07-10 21:39:36'),('8ea8f958c3a048858f79c16f1d0a1d43','Data Synchronization','Remote clients with temporary access to the data base layer can download a copy from the master, go offline, do changes and when network is available synchronize the changes with the master.','/img/sync.png',7,'2012-07-10 21:39:36'),('9001e75fd713447d8f92ed940d106c8b','Usage of highly-scalable data stores (NoSQL, Blob Store)','Migrate from a RDBMS which is not highly-scalable to a highly scalabe Cloud data store like a NoSQL or Blob store).','/img/scalable.png',2,'2012-07-10 21:39:36'),('9e159e1c56604216a8c5bf21267b9f8e','Data Distribution (Sharding)','Data is split into disjunct parts and moved to different data centers. This is helpful to reduce latency by moving the data closer to the client and additionally increase (horizontal) scalability. Horizontal scalability means that e.g. all rows belonging to a certain client are stored in one data center and rows belonging to another client in another data center.','/img/data-distribution.png',4,'2012-07-10 21:39:36'),('a6e474fa91974f449aa2ddf90894be77','Data Usage from the Cloud','Outsourcing of the data base layer without moving the whole application to the Cloud. In cases when the increased latency is tolerable, this is an easy strategy to move data silos to the Cloud and allow more clients to access the data. The local client then accesses the remote Cloud data store.','/img/data-usage.png',11,'2012-07-10 21:39:36'),('a6e82bb652b14f0389632b6d2114dec7','Work on Copy of Data (Data Analysis and Monitoring)','In order to run ressource demanding data analysis without effecting the production server, the data base layer can be cloned and the analysis can be done on the copy.','/img/data-copy.png',6,'2012-07-10 21:39:36'),('c88cc1cdb6dd471d9d2cf0a8e6b9287f','Data Import from the Cloud','Copying of data from a Cloud service (access via API) to a local data store in order to work on the data with low latency.','/img/import.png',10,'2012-07-10 21:39:36'),('f71f49480f27414081e370e723f9eab5','Geographic Replication','In order to reduce latency the data is moved close to the client and/or to the data processing unit. Usually the whole application itself is migrated to the Cloud as well.','/img/replication.png',3,'2012-07-10 21:39:36');
/*!40000 ALTER TABLE `CDMScenario` ENABLE KEYS */;
UNLOCK TABLES;

