INSERT INTO `CloudDataStore` VALUES ('25f8a91dcdac4f0fa7f703e3bf787254','Google Cloud SQL','Google','https://developers.google.com/cloud-sql/','Google Cloud SQL is a web service that allows you to create, configure, and use relational databases that live in Google\'s cloud. It is a fully-managed service that maintains, manages, and administers your databases, allowing you to focus on your applications and services. By offering the capabilities of a familiar MySQL database, the service enables you to easily move your data, applications, and services in and out of the cloud. This enables high data portability and helps you achieve faster time-to-market because you can quickly leverage your existing database.','2012-07-10 21:37:33','2012-08-19 13:04:52'),('297ee2e13936109601393618f2f60020','Amazon EC2','Amazon Web Services (AWS)','http://aws.amazon.com/ec2/','EC2 is Infrastructure as a Service which allows you to do almost anything with it. Therefore the capabilities are specified as \'maximum\' imaginable values. Since EC2 is very flexible you can install almost any kind of data store product: NoSQL, RDBMS, Blob Store or CDN. Amazon Elastic Compute Cloud (Amazon EC2) is a web service that provides resizable compute capacity in the cloud. It is designed to make web-scale computing easier for developers. Amazon EC2\'s simple web service interface allows you to obtain and configure capacity with minimal friction. It provides you with complete control of your computing resources and lets you run on Amazon\'s proven computing environment. Amazon EC2 reduces the time required to obtain and boot new server instances to minutes, allowing you to quickly scale capacity, both up and down, as your computing requirements change. Amazon EC2 changes the economics of computing by allowing you to pay only for capacity that you actually use. Amazon EC2 provides developers the tools to build failure resilient applications and isolate themselves from common failure scenarios.','2012-08-17 21:39:28','2012-08-19 21:35:36'),('297ee2e139361096013936639dd6010d','Amazon Simple Storage Service (S3)','Amazon Web Services (AWS)','http://aws.amazon.com/s3/','Amazon S3 is storage for the Internet. It is designed to make web-scale computing easier for developers. Amazon S3 provides a simple web services interface that can be used to store and retrieve any amount of data, at any time, from anywhere on the web. It gives any developer access to the same highly scalable, reliable, secure, fast, inexpensive infrastructure that Amazon uses to run its own global network of web sites. The service aims to maximize benefits of scale and to pass those benefits on to developers.','2012-08-17 23:01:00','2012-08-19 13:04:17'),('297ee2e1393610960139366a01fe0176','Amazon CloudFront','Amazon Web Services (AWS)','http://aws.amazon.com/cloudfront/','Amazon CloudFront is a web service for content delivery. It integrates with other Amazon Web Services to give developers and businesses an easy way to distribute content to end users with low latency, high data transfer speeds, and no commitments. Amazon CloudFront can be used to deliver your entire website, including dynamic, static and streaming content using a global network of edge locations. Requests for your content are automatically routed to the nearest edge location, so content is delivered with the best possible performance. Amazon CloudFront is optimized to work with other Amazon Web Services, like Amazon Simple Storage Service (Amazon S3), Amazon Elastic Compute Cloud (Amazon EC2), Amazon Elastic Load Balancing, and Amazon Route 53. Amazon CloudFront also works seamlessly with any non-AWS origin server, which stores the original, definitive versions of your files. Like other Amazon Web Services, there are no contracts or monthly commitments for using Amazon CloudFront &Atilde;&cent;?? you pay only for as much or as little content as you actually deliver through the service.','2012-08-17 23:08:00','2012-08-19 13:04:06'),('402832a5392b3fa601392b619d1c004a','Amazon Relational Database Service (RDS) - MySQL Engine','Amazon Web Services (AWS)','http://aws.amazon.com/rds/','Amazon RDS makes it easy to set up, operate, and scale MySQL deployments in the cloud. With Amazon RDS, you can deploy scalable MySQL deployments in minutes with cost-efficient and resizable hardware capacity. Amazon RDS frees you up to focus on application development by managing time-consuming database administration tasks including backups, software patching, monitoring, scaling and replication. Amazon RDS gives you access to the full capabilities of a familiar MySQL database. This means the code, applications, and tools you already use today with your existing MySQL databases work seamlessly with Amazon RDS. Amazon RDS automatically patches the database software and backs up your database, storing the backups for a user-defined retention period and enabling point-in-time recovery. You benefit from the flexibility of being able to scale the compute resources or storage capacity associated with your relational database instance via a single API call. In addition, Amazon RDS makes it easy to use replication to enhance availability and reliability for production databases and to scale out beyond the capacity of a single database deployment for read-heavy database workloads. As with all Amazon Web Services, there are no up-front investments required, and you pay only for the resources you use.','2012-08-15 19:43:01','2012-08-19 13:03:36'),('402832a5392b3fa601392b6fadbf00b0','Amazon Relational Database Service (RDS) - SQL Server Engine','Amazon Web Services (AWS)','http://aws.amazon.com/rds/','Amazon RDS for Microsoft SQL Server makes it easy to set up, operate, and scale SQL Server deployments in the cloud. With Amazon RDS, you can deploy multiple editions of SQL Server (2008 R2) including Express, Web, Standard and Enterprise, in minutes with cost-efficient and re-sizable compute capacity. Amazon RDS frees you up to focus on application development by managing time-consuming database administration tasks including provisioning, backups, software patching, monitoring, and hardware scaling. Beyond the Free Tier, you can run Amazon RDS for SQL Server under two different licensing models License Included and License Mobility through Software Assurance (or Bring Your Own License BYOL). In the &quot;License Included&quot; service model, you do not need separately purchased Microsoft SQL Server licenses. &quot;License Included&quot; pricing starts at $0.035 per hour and is inclusive of software, underlying hardware resources, and Amazon RDS management capabilities. Microsofts License Mobility program allows customers who already own SQL Server licenses to run SQL Server deployments on Amazon RDS. This benefit is available to Microsoft Volume Licensing (VL) customers with SQL Server licenses covered by active Microsoft Software Assurance (SA) contracts. The Microsoft License Mobility program is suited for customers who prefer to use existing SQL Server licenses or purchase new licenses directly from Microsoft. You can take advantage of hourly pricing with no upfront fees or long-term commitments. In addition, you also have the option to purchase Reserved DB Instances under one or three year reservation terms. With Reserved DB Instances, you can make low, one-time, upfront payment for each DB Instance and then pay a significantly discounted hourly usage rate, achieving up to 65% net cost savings.','2012-08-15 19:58:22','2012-08-19 13:03:29'),('402832a5392b3fa601392b7739a90157','Amazon Relational Database Service (RDS) - Oracle Engine','Amazon Web Services (AWS)','http://aws.amazon.com/rds/','Amazon RDS makes it easy to set up, operate, and scale Oracle Database deployments in the cloud. With Amazon RDS, you can deploy multiple editions of Oracle Database 11g in minutes with cost-efficient and re-sizable hardware capacity. Amazon RDS frees you up to focus on application development by managing time-consuming database administration tasks including provisioning, backups, software patching, monitoring, and hardware scaling. You can run Amazon RDS for Oracle under two different licensing models License Included and Bring-Your-Own-License (BYOL). In the &quot;License Included&quot; service model, you do not need separately purchased Oracle licenses; the Oracle Database software has been licensed by AWS. &quot;License Included&quot; pricing starts at $0.16 per hour, inclusive of software, underlying hardware resources, and Amazon RDS management capabilities. If you already own Oracle Database licenses, you can use the &quot;BYOL&quot; model to run Oracle deployments on Amazon RDS, with rates starting at $0.11 per hour. The model is designed for customers who prefer to use existing Oracle database licenses or purchase new licenses directly from Oracle. You can take advantage of hourly pricing with no upfront fees or long-term commitments. In addition, you also have the option to purchase Reserved DB Instances under one or three year reservation terms. With Reserved DB Instances, you can make low, one-time, upfront payment for each DB Instance and then pay a significantly discounted hourly usage rate, achieving up to 48% net cost savings.','2012-08-15 20:06:37','2012-08-19 13:03:15'),('402832a5392b3fa601392bda0bb403ce','SQL Database, formerly SQL Azure Database (Windows Azure)','Microsoft','https://www.windowsazure.com/en-us/home/features/data-management/','For applications that need a full featured relational database-as-a-service, Windows Azure offers SQL Database, formerly known as SQL Azure Database. SQL Database offers a high-level of interoperability, enabling customers to build applications using many of the major development frameworks. Additionally, SQL Database, based on the proven technologies of SQL Server, provides the ability to use existing skills and knowledge to accelerate time to solution as well as build or extend applications across on-premises and cloud. Learn more about business analytics cloud services based on SQL Server. Use SQL Database to: Build enterprise apps SQL Database is an ideal database for a wide variety of business applications including transaction processing, departmental or line of business solutions. Deliver sophisticated cloud-based services with proven reliability and performance. Get massive scale out for your relational databases through sharding with SQL Federation, provide secure and reliable access to data with familiar control mechanisms, and easily deploy your databases with no physical administration required. Power hybrid applications SQL Database can be accessed from applications hosted in Windows Azure as well as from applications hosted on-premises. Data can easily be shared across SQL Database and SQL Server databases, as well as across multiple SQL Databases with SQL Data Sync.','2012-08-15 21:54:29','2012-08-20 23:43:54'),('402832a5393112570139311257800000','Amazon SimpleDB','Amazon Web Services (AWS)','http://aws.amazon.com/simpledb/','Amazon SimpleDB is a highly available and flexible non-relational data store that offloads the work of database administration. Developers simply store and query data items via web services requests and Amazon SimpleDB does the rest. Unbound by the strict requirements of a relational database, Amazon SimpleDB is optimized to provide high availability and flexibility, with little or no administrative burden. Behind the scenes, Amazon SimpleDB creates and manages multiple geographically distributed replicas of your data automatically to enable high availability and data durability. The service charges you only for the resources actually consumed in storing your data and serving your requests. You can change your data model on the fly, and data is automatically indexed for you. With Amazon SimpleDB, you can focus on application development without worrying about infrastructure provisioning, high availability, software maintenance, schema and index management, or performance tuning.','2012-08-16 22:14:08','2012-08-16 22:31:26'),('402832a53931125701393134df1f0039','Amazon DynamoDB','Amazon Web Services (AWS)','http://aws.amazon.com/dynamodb/','Amazon DynamoDB is a fully managed NoSQL database service that provides fast and predictable performance with seamless scalability. With a few clicks in the AWS Management Console, customers can launch a new Amazon DynamoDB database table, scale up or down their request capacity for the table without downtime or performance degradation, and gain visibility into resource utilization and performance metrics. Amazon DynamoDB enables customers to offload the administrative burdens of operating and scaling distributed databases to AWS, so they don&acirc;??t have to worry about hardware provisioning, setup and configuration, replication, software patching, or cluster scaling. Amazon DynamoDB is designed to address the core problems of database management, performance, scalability, and reliability. Developers can create a database table that can store and retrieve any amount of data, and serve any level of request traffic. DynamoDB automatically spreads the data and traffic for the table over a sufficient number of servers to handle the request capacity specified by the customer and the amount of data stored, while maintaining consistent, fast performance. All data items are stored on Solid State Drives (SSDs) and are automatically replicated across three Availability Zones in a Region to provide built-in high availability and data durability. Amazon DynamoDB enables customers to offload the administrative burden of operating and scaling a highly available distributed database cluster while only paying a low variable price for the resources they consume.','2012-08-16 22:51:52',NULL),('ff8080813945fbd6013945fbd6760000','App Engine Datastore (High Replication)','Google','tbd.','tbd.','2012-08-20 23:41:35',NULL);
