INSERT INTO `Impact` VALUES ('103121593b3b433a8d5f24a66ced1923','Connection Strings','DAL_CONNECTION_STRINGS','If the source and target system are compatible it can be sufficient to change the connection strings of all applications using the old source system to point to the address of the new target system. Make sure that not only applications that use the old source system are adapted, but also failover configurations, monitoring scripts and backup scripts.',1,'80dd23e2617b4059b59a947f25dc5707'),('375f53c3c716435c8fe14e8f6f7ed2a6','Data Store Type Change','APPLICATION_TYPE_CHANGE','If the type of the data store (RDBMS, NoSQL, Blob) changes during the data migration it is usually not sufficient enough to simulate missing functionality in the data access layer. If for example the schema is no fixed, or joins, strict consistency and ACID transactions are not supported any more, the application logic has to be adapted to reflect the conceptual changes. In case of migrating from a RDBMS to a NoSQL and Blob store, a small part of the data could still be required to be stored in a RDBMS to support e.g. financial transactions.',1,'376d0e0a16cd450887ce8e45d0fdd92b'),('4f4be3b7800949ba95525baca055d6e7','Semantic (Schema vs. DB Name)','DAL_SEMANTICS_DB_SCHEMA','Some data stores have a different semantic what a database and schema is (e.g. Oracle and SQL Server). This can be translated by the data access layer without adapting any upper application layers.',5,'80dd23e2617b4059b59a947f25dc5707'),('57563056436744e49911adfd160b5729','Product Change (Data Types, etc.)','APPLICATION_PRODUCT_CHANGE','If the product of the data store changes during the migration the semantics of e.g. comparison operators could have changed which cannot be translated by the data access layer and requires the application layer to be adopted.',4,'376d0e0a16cd450887ce8e45d0fdd92b'),('6b8db3723d724fcd840f5865ddc15c04','Sorting','DAL_SORTING','If the target system is a NoSQL datastore and supports sorting of result sets, it may be necessary to add zero-padding for numbers and an offset to columns with negative numbers if the ordering is done in lexicographical order.',9,'80dd23e2617b4059b59a947f25dc5707'),('76e49d346c444d20badd50f34a441d79','Firewall (Open Ports)','NETWORK_FIREWALL','If the new target system is available under a different IP address or port then firewall settings need to be updated to allow all applications to access the new target system. It can also be useful to setup a Virtual Private Cloud (VPC).  Make sure that not only the firewall settings for applications that use the old source system are adapted, but also the firewall settings for failover configurations, monitoring scripts and backup scripts.',3,'e4c4ff18754843229fe504fd6da46c6b'),('7a83954534084ff8b7b1beaa39431264','Semantics (Comparisions, Locks)','APPLICATION_SEMANTICS','Despite SQL being a standardised language, most vendors add product specific SQL commands or differ in the semantics of e.g. locks to allow dirty reads or more fine grained locks. These differences have to be identified during the migration and applied to the application layer.',5,'376d0e0a16cd450887ce8e45d0fdd92b'),('7da15bdb76cf4364bd84414c87aa2c14','CNAME','NETWORK_CNAME','If the source and target system are compatible and the source system is currently addressed via an URL, a change of the CNAME entry to point to the new target system is sufficient to allow all applications to use the new target system.',1,'e4c4ff18754843229fe504fd6da46c6b'),('9599eaf414dd458fb3ca22f71387ef93','Cloud Data Pattern','DAL_CLOUD_DATA_PATTERN','If the source and target system are not compatible, Cloud Data Patterns can be used to simulate missing functionality, e.g. non-standard SQL commands.',2,'80dd23e2617b4059b59a947f25dc5707'),('a268125e1fa34b53a98f6497132857d6','Synchronisation','DAL_SYNC','In the geographic replication scenario the data access layer and above layers like the application layer have to be aware that the same layers run in parallel at different Cloud data centers and that the database layer has to be synchronized in the background.<br />In the data synchronisation scenario the synchronisation between the local replica and the Cloud master database has to be setup. This can be done by a synchronisation functionality of the RDBMS or by the data access layer or an external synchronisation tool.',3,'80dd23e2617b4059b59a947f25dc5707'),('acbb9cbe16194a93a94c4295b4647833','Cloud Data Pattern Effects','APPLICATION_CLOUD_DATA_PATTERN','If Cloud Data Patterns for Confidentiality are used in the data access layer, the application layer has to be aware that it might not have a full view on the actual data, since it could be anonymized, filtered or pseudonymized.',3,'376d0e0a16cd450887ce8e45d0fdd92b'),('adc67bc850cc4180ad3b8b734f0e78ee','Naming Conventions','DAL_NAMING','Most data stores have different naming conventions, therefore short, uppercase identifiers (table names, row names, constraint names) without special characters and potentially reserved words should be used. The data access layer can transform denied identifiers on the fly to allowed ones without the need to adapt upper application layers.',6,'80dd23e2617b4059b59a947f25dc5707'),('b492ac0881fb415e9c0b946cc247befb','Outsource Complex Queries','APPLICATION_COMPLEX_QUERIES','NoSQL data stores usually don\'t support complex queries using joins and aggregate functions on the data store level, but there are external services that could be used to defere complex queries on NoSQL data stores, e.g. using a MapReduce cluster. Using those services located closely to the data store can increase performance and reduce traffic compared to simulating complex queries on the client.',2,'376d0e0a16cd450887ce8e45d0fdd92b'),('b9ff451b96104adab31af07b12445817','Semantics (\"\" vs. Null)','DAL_SEMANTICS_EMPTY_NULL','Some databases don\'t support null values for data entries, if the previous data store supported these, the data access layer can in some cases resolve that conflict if the applications itself don\'t differentiate between \'null\' and empty values. If the applications differentiate between \'null\' and empty values, the upper application layers have to be adopted.',8,'80dd23e2617b4059b59a947f25dc5707'),('bbd41e96bdf94108a0fa8012535c3af8','Data Types','DAL_DATA_TYPES','Most data stores support different sets of data types which the data access layer can transform on the fly without the need to change upper application layers (e.g. BOOLEAN to BIT or CHAR(1)).',7,'80dd23e2617b4059b59a947f25dc5707'),('bc10d26aa4d246aaafb0a78f52467b79','DNS Cache TTL','NETWORK_DNS_TTL','If the CNAME entry can be adapted to point to the new target system, make sure the DNS cache of all applications that use the old source system have a short time to live (TTL).',2,'e4c4ff18754843229fe504fd6da46c6b'),('cb20b8547cdc4bd1a4445bb691be51f7','Cloud Burst Migration','DAL_CLOUD_BURST','In the Cloud Burst scenario the data access layer can trigger the Cloud Burst case as well as the remigration back to the local data center. This decision can also be made by an external monitoring tool that calls the (re)migration scripts.',4,'80dd23e2617b4059b59a947f25dc5707'),('gfrb7stf41432v12r11r1995e1865944','Attribute Size','DAL_ATTRIBUTE_SIZE','If the target system is a NoSQL datastore and allows only small values for attributes (e.g. max. 1kB), then larger values have to be stored in a Blob store and a pointer to the location in the Blob store can work as an intermediary attribute.',10,'80dd23e2617b4059b59a947f25dc5707');
