INSERT INTO `Project` VALUES ('297e2ba5393e1f2e01393e1f2e410000','Cloud Data Migration Tool (Usage of highly-scalable data stores [NoSQL, Blob Store])','The Cloud Data Migration Tool (CDM) allows for migrating the data layer of an application to a cloud data store. The application itself is a Java Web application which uses a local MySQL database as data layer. The migration of the whole application to the Cloud should allow to use a compatible data store in the cloud.','IAAS','http://www.iaas.uni-stuttgart.de/','ff2c28ae2f6147f88b4471d102129077','402832a5393112570139311257800000','2012-08-19 11:03:14','2012-08-21 22:26:05'),('297e8c6a39405d360139405d36510000','Cloud Data Migration Tool (Plain Outsourcing, Reuse Virtual Machine/IaaS)','The Cloud Data Migration Tool (CDM) allows for migrating the data layer of an application to a cloud data store. The application itself is a Java Web application which uses a local MySQL database as data layer. The migration of the whole application to the Cloud should allow to use a compatible data store in the cloud.','IAAS','http://www.iaas.uni-stuttgart.de/','ff2c28ae2f6147f88b4471d102129077','297ee2e13936109601393618f2f60020','2012-08-19 21:30:13','2012-08-19 21:38:24'),('297ee2e13936109601393626b11000e2','Cloud Data Migration Tool (Data Usage from the Cloud, Product Change)','The Cloud Data Migration Tool (CDM) allows for migrating the data layer of an application to a cloud data store. The application itself is a Java Web application which uses a local MySQL database as data layer. The migration of the whole application to the Cloud should allow to use a compatible data store in the cloud.','IAAS','http://www.iaas.uni-stuttgart.de/','ff2c28ae2f6147f88b4471d102129077','402832a5392b3fa601392bda0bb403ce','2012-08-17 21:54:29','2012-08-17 22:04:44'),('2ec339c01d7e4bd0a4b7bc21192a29e0','Cloud Data Migration Tool (Data Usage from the Cloud, Hosted MySQL)','The Cloud Data Migration Tool (CDM) allows for migrating the data layer of an application to a cloud data store. The application itself is a Java Web application which uses a local MySQL database as data layer. The migration of the whole application to the Cloud should allow to use a compatible data store in the cloud.','IAAS','http://www.iaas.uni-stuttgart.de/','ff2c28ae2f6147f88b4471d102129077','25f8a91dcdac4f0fa7f703e3bf787254','2012-07-10 21:36:24','2012-08-17 22:05:27'),('402832a53907cdbc013907cdbc710000','Cloud Data Migration Tool (Data Usage from the Cloud, Reuse Virtual Machine/IaaS)','The Cloud Data Migration Tool (CDM) allows for migrating the data layer of an application to a cloud data store. The application itself is a Java Web application which uses a local MySQL database as data layer. The migration of the whole application to the Cloud should allow to use a compatible data store in the cloud.','IAAS','http://www.iaas.uni-stuttgart.de/','ff2c28ae2f6147f88b4471d102129077','297ee2e13936109601393618f2f60020','2012-08-08 21:54:46','2012-08-17 22:05:11');
