INSERT INTO `Solution` VALUES ('00f27b2a8a734c0aa45a73789855618a','Adaption of application logic','If your migration scenario requires scalability of your target system, but it isn\'t, you can adapt your application logic to switch between read and write replicas.',NULL,'a27b90b03c1b4fde98363393cfaf3dbe','f27df0d8cb7c41999d71658fb4bb536d',NULL),('0285762c773245229b5bd3e9cae6662d','Adaption of application logic','If your migration scenario requires scalability of your target system, but it isn\'t, you can adapt your application logic to switch between read and write replicas.',NULL,'a27b90b03c1b4fde98363393cfaf3dbe','767e87c5cd1d40edbccbdc80a01c0eea',NULL),('0c1c842f1b2f4d92b6a3ab9b922c7c8c','Adaption of the data access layer','If your target system does not ensure confidentiality, you can adapt your data access layer to prohibit storing sensitive data there.',NULL,'f60ea4bed33b42a09cfdee851269c3e6',NULL,NULL),('149205d31b8c4ddba980ed61b1a2cffb','Pseudonymizer of Critical Data','If your target system is hosted in a public cloud, you can use a cloud data pattern called \'Pseudonymizer of Critical Data\' to ensure your critical data is not exposed.',NULL,'b3b4bbed35bf4b85b1569706478eaf3f',NULL,NULL),('1672b769a86f42c3a2a1cd859a80c429','Adaption of application logic','If your current system is a RDBMS and uses stored procedures or triggers and your target system is a NoSQL data store that does not support stored procedures or triggers, you can adapt your application logic to process the stored procedure and trigger logic.',NULL,NULL,'9fc489edbb7143b4a8e0e34ec28de696','b0453d5f797f4bcea87d820ac9af042b'),('17289460327a424897238266d26ea0ee','Anonymizer of Critical Data','If your target system is hosted in a public cloud, you can use a cloud data pattern called \'Anonymizer of Critical Data\' to ensure your critical data is not exposed.',NULL,'b3b4bbed35bf4b85b1569706478eaf3f',NULL,NULL),('1f917c6f3b204f0cbe230c78732e3360','Adaption of application logic','If your target system is hosted in a public cloud, you can adapt your application logic to prohibit storing sensitive data there.',NULL,'b3b4bbed35bf4b85b1569706478eaf3f',NULL,NULL),('2421d19c06a1467eb7e69b110dc84a5c','Local Sharding-Based Router','If your migration scenario requires sharding functionality in your target system, but it isn\'t supported, you can use a cloud data pattern called \"Local Sharding-Based Router\".',NULL,'a27b90b03c1b4fde98363393cfaf3dbe','f27df0d8cb7c41999d71658fb4bb536d',NULL),('246d45aea1124700bca7d8a91f924c09','Pseudonymizer of Critical Data','If your target system does not ensure confidentiality, you can use a cloud data pattern called \'Pseudonymizer of Critical Data\'.',NULL,'f60ea4bed33b42a09cfdee851269c3e6',NULL,NULL),('309ae0a508d24ae1a2d96789162102c1','Adaption of application logic','If your source system is a RDBMS and target system a NoSQL data store and you use complex SQL queries which are not supported in the NoSQL store, you can adapt your application logic to use simpler request and applying the query logic on the client side.','695d65b893ce4490882d330509abd08d','d595c54a28e442ecb26e8146534c7e91',NULL,NULL),('31c90ea65b1a4ea78a3fb802eb004813','Adaption of the data access layer','If your migration scenario requires sharding functionality in your target system, but it isn\'t supported, you can adapt your data access layer to select the right shard for every query.',NULL,'a27b90b03c1b4fde98363393cfaf3dbe','f27df0d8cb7c41999d71658fb4bb536d',NULL),('323d2dbedeed462888521bebc7c8e4cd','Adaption of application logic','If your migration scenario requires sharding functionality in your target system, but it isn\'t supported, you can adapt your application logic to select the right shard for every query.',NULL,'a27b90b03c1b4fde98363393cfaf3dbe','f27df0d8cb7c41999d71658fb4bb536d',NULL),('361d7151a88f4481841e0410763a3118','Data Store Functionality Extension','If your current system is different (product) than your target system, then a cloud data pattern called \"Data Store Functionality Extension\" can simulate features and semantics that the target system does not understand or would handle differently.',NULL,NULL,'62e55fa92c5649e099ef4aba5f82703d',NULL),('3b4b17b9b57248a7b81f910b71bcfb96','Filter of Critical Data','If your target system is hosted in a public cloud, you can use a cloud data pattern called \'Filter of Critical Data\' to ensure your critical data is not exposed.',NULL,'b3b4bbed35bf4b85b1569706478eaf3f',NULL,NULL),('488a1826c7cf495cb7868ab17b79007c','Adaption of the data access layer','If your migration scenario requires scalability of your target system, but it isn\'t, you can adapt your data access layer to switch between read and write replicas.',NULL,'a27b90b03c1b4fde98363393cfaf3dbe','f27df0d8cb7c41999d71658fb4bb536d',NULL),('4e296da0a04542528e81c31a6af0fc4e','Confidentiality Level Data Aggregator','If your target system is hosted in a public cloud, you can use a cloud data pattern called \'Confidentiality Level Data Aggregator\' to ensure your critical data is not exposed.',NULL,'b3b4bbed35bf4b85b1569706478eaf3f',NULL,NULL),('4e4af00cfc3f4dcdaa5d2470de818b4a','Anonymizer of Critical Data','If your target system does not ensure confidentiality, you can use a cloud data pattern called \'Anonymizer of Critical Data\'.',NULL,'f60ea4bed33b42a09cfdee851269c3e6',NULL,NULL),('556b9a3c338f4975ba1636ce86b127ce','Adaption of the data access layer','If your target system is hosted in a public cloud, you can adapt your data access layer to prohibit storing sensitive data there.',NULL,'b3b4bbed35bf4b85b1569706478eaf3f',NULL,NULL),('587ddff3bf93454ca1b7e28b55fc0931','Change connection strings','If your source and target system is addressed via a DNS resolvable URL and the source and target data store are compatible you can adapt the connection strings in the application settings and configure your firewall to allow access to the target data store.','0161517218744bcc80d12ee76c69024e',NULL,NULL,NULL),('5a093609d9a24916a7f50bc7bf651ff5','Adaption of application logic','If your target system does not ensure confidentiality, you can adapt your application layer to prohibit storing sensitive data there.',NULL,'f60ea4bed33b42a09cfdee851269c3e6',NULL,NULL),('5a9fbcdcbc494e6698c52310e8b85446','Local Database Proxy','If your migration scenario requires scalability of your target system, but it isn\'t, you can use a cloud data pattern called \"Local Database Proxy\".',NULL,'a27b90b03c1b4fde98363393cfaf3dbe','f27df0d8cb7c41999d71658fb4bb536d',NULL),('5c618103cecc4394ae0e3782f8cbafdb','Local Sharding-Based Router','If your migration scenario requires sharding functionality in your target system, but it isn\'t supported, you can use a cloud data pattern called \"Local Sharding-Based Router\".',NULL,'a27b90b03c1b4fde98363393cfaf3dbe','767e87c5cd1d40edbccbdc80a01c0eea',NULL),('5dc0c743a8404b09b27113be0c0a9b24','Adaption of application logic','If your current system is different (version) than your target system, then you can adapt your application logic to not use features that are not supported and use different semantics as required by the target system.',NULL,NULL,'4c37de5ceb8441e48f38c7208dce235a',NULL),('667ed10a38e4420599326fdab0afcdba','Confidentiality Level Data Aggregator','If your target system does not ensure confidentiality, you can use a cloud data pattern called \'Confidentiality Level Data Aggregator\'.',NULL,'f60ea4bed33b42a09cfdee851269c3e6',NULL,NULL),('6e61d311f8d14e89b75d14a6165fa62f','Local Database Proxy','If your migration scenario requires scalability of your target system, but it isn\'t, you can use a cloud data pattern called \"Local Database Proxy\".',NULL,'a27b90b03c1b4fde98363393cfaf3dbe','767e87c5cd1d40edbccbdc80a01c0eea',NULL),('7b5b7aee3dee47feadcc10baedb18071','Instanciate and synchronize multiple instances','If your target system does not support high availability and high scalability of read requests then you can instanciate multiple instances and setup synchronization between them.',NULL,'c2fe8be8df264d4cbbbc562b2b904e00',NULL,NULL),('84ba6836cc194066b271ee194c6109a0','Adaption of application logic','If your migration scenario requires one-way syncing but the source or target system does not support it, you can adapt your application logic to sync the data manually.',NULL,'24566eb326d9462b8214ff8340a4fb1a','b49a5386fd654055a50be10b027bbfd3',NULL),('86d59c96fab14e848302c6bf9b6d7da7','Change CNAME, DNS Cache TTL and Firewall','If your source and target system is addressed via a DNS resolvable URL and the source and target data store are compatible you can just change the CNAME entry to point to the new target system, check that the DNS Cache TTL is low and configure your firewall to allow access to the target data store.','0161517218744bcc80d12ee76c69024e',NULL,NULL,NULL),('954a73d9fec34fc9813e48eba3bfe0c2','Adaption of the data access layer','If your current system is a RDBMS and uses stored procedures or triggers and your target system is a NoSQL data store that does not support stored procedures or triggers, you can adapt your data access layer to process the stored procedure and trigger logic.',NULL,NULL,'9fc489edbb7143b4a8e0e34ec28de696','b0453d5f797f4bcea87d820ac9af042b'),('97af422d6ebd40d29983f47e21f36d78','Adaption of the data access layer','If your current system is different (version) than your target system, then you can adapt your data access layer to simulate the missing features and translate the different semantics.',NULL,NULL,'4c37de5ceb8441e48f38c7208dce235a',NULL),('a9baeec7451b473b9fc353bd39f00361','Change connection strings','If your source and target system is addressed via IP and the source and target data store are compatible you can adapt the connection strings in the application settings and configure your firewall to allow access to the target data store.','e5dd7851d8a649c48a5d459411b80bac',NULL,NULL,NULL),('b000879d77e54995bf979ca41cce44a1','Adaption of application logic','If your migration scenario requires sharding functionality in your target system, but it isn\'t supported, you can adapt your application logic to select the right shard for every query.',NULL,'a27b90b03c1b4fde98363393cfaf3dbe','767e87c5cd1d40edbccbdc80a01c0eea',NULL),('b965c6726ed54388aa482818816cbc12','Filter of Critical Data','If your target system does not ensure confidentiality, you can use a cloud data pattern called \'Filter of Critical Data\'.',NULL,'f60ea4bed33b42a09cfdee851269c3e6',NULL,NULL),('bb9b63ffaf3a44e787978d3ff65ed614','Adaption of the data access layer','If your migration scenario requires scalability of your target system, but it isn\'t, you can adapt your data access layer to switch between read and write replicas.',NULL,'a27b90b03c1b4fde98363393cfaf3dbe','767e87c5cd1d40edbccbdc80a01c0eea',NULL),('bdbf81a077364f1a96fc7ef29737f20e','Adaption of the data access layer','If your migration scenario requires two-way syncing but the source or target system does not support it, you can adapt your data access layer to sync the data manually.',NULL,'6f0c63597b094dbe9303bf01fb7055a3','25940cadc9fa4d60bfb9a8a8bfa17c03',NULL),('c2298a15c3da447f9ccc3278a84c093f','Data Store Functionality Extension','If your current system is different (version) than your target system, then a cloud data pattern called \"Data Store Functionality Extension\" can simulate features and semantics that the target system does not understand or would handle differently.',NULL,NULL,'4c37de5ceb8441e48f38c7208dce235a',NULL),('c3c1c0bb3b2c4863a967745a8f4e7a26','Adaption of the data access layer','If your current system is different (product) than your target system, then you can adapt your data access layer to simulate the missing features and translate the different semantics.',NULL,NULL,'62e55fa92c5649e099ef4aba5f82703d',NULL),('c8946905dddc4c6bb9af27260b596761','ETL Tool or other third party data migration tool','If your migration scenario requires two-way syncing but the source or target system does not support it, you can use ETL or third party migration tools to im- and export the data manually.',NULL,'6f0c63597b094dbe9303bf01fb7055a3','25940cadc9fa4d60bfb9a8a8bfa17c03',NULL),('c8cbc609df364a69aa1d14dcfc223ae6','ETL Tool or other third party data migration tool','If your migration scenario requires one-way syncing but the source or target system does not support it, you can use ETL or third party migration tools to im- and export the data manually.',NULL,'24566eb326d9462b8214ff8340a4fb1a','b49a5386fd654055a50be10b027bbfd3',NULL),('d605ffd4a295434fae4b147493ae5ff7','Emulator of Stored Procedures','If your current system is a RDBMS and uses stored procedures or triggers and your target system is a NoSQL data store that does not support stored procedures or triggers, you can use a cloud data pattern called \"Emulator of Stored Procedures\" that interprets stored procedures and triggers.',NULL,NULL,'9fc489edbb7143b4a8e0e34ec28de696','b0453d5f797f4bcea87d820ac9af042b'),('deb94eb67bb84747af2f0d9d096c1809','External services for complex queries','If your source system is a RDBMS and target system a NoSQL data store and you use complex SQL queries which are not supported in the NoSQL store, you can use external services that allow complex queries on NoSQL databases like AWS Elastic MapReduce.','695d65b893ce4490882d330509abd08d','d595c54a28e442ecb26e8146534c7e91',NULL,NULL),('ea2dd53602a54e76a643b2b90f84fc1b','Adaption of the data access layer','If your migration scenario requires one-way syncing but the source or target system does not support it, you can adapt your data access layer to sync the data manually.',NULL,'24566eb326d9462b8214ff8340a4fb1a','b49a5386fd654055a50be10b027bbfd3',NULL),('ede870191a614344b0d41e789dde7eda','Pool of reserved instances','If your resource utilization can grow faster than it takes to launch a new instance, you can use a pool of spare resource to have constant response time.',NULL,'a27b90b03c1b4fde98363393cfaf3dbe','29b087f9c3604e13ae7bc78147e787f8',NULL),('f46ef2f92eff4e79ab1550c640e83d37','Adaption of the data access layer','If your source system is a RDBMS and target system a NoSQL data store and you use complex SQL queries which are not supported in the NoSQL store, you can adapt your data access layer to simulate those complex queries by splitting them into simpler request and applying the query logic on the client side.','695d65b893ce4490882d330509abd08d','d595c54a28e442ecb26e8146534c7e91',NULL,NULL),('f61a96f236384ec5bfcda54a7121bc78','Adaption of the data access layer','If your migration scenario requires sharding functionality in your target system, but it isn\'t supported, you can adapt your data access layer to select the right shard for every query.',NULL,'a27b90b03c1b4fde98363393cfaf3dbe','767e87c5cd1d40edbccbdc80a01c0eea',NULL),('f8f888b939e94370bbafbcd76a61f647','Adaption of application logic','If your migration scenario requires two-way syncing but the source or target system does not support it, you can adapt your application logic to sync the data manually.',NULL,'6f0c63597b094dbe9303bf01fb7055a3','25940cadc9fa4d60bfb9a8a8bfa17c03',NULL),('fadc967730934c6ab6406b35a2037b8f','Adaption of application logic','If your current system is different (product) than your target system, then you can adapt your application logic to not use features that are not supported and use different semantics as required by the target system.',NULL,NULL,'62e55fa92c5649e099ef4aba5f82703d',NULL);
