INSERT INTO `CloudDataStore` VALUES ('25f8a91dcdac4f0fa7f703e3bf787254','Google Cloud SQL','Google','https://developers.google.com/cloud-sql/','Google Cloud SQL is a web service that allows you to create, configure, and use relational databases that live in Google\'s cloud. It is a fully-managed service that maintains, manages, and administers your databases, allowing you to focus on your applications and services.\n\nBy offering the capabilities of a familiar MySQL database, the service enables you to easily move your data, applications, and services in and out of the cloud. This enables high data portability and helps you achieve faster time-to-market because you can quickly leverage your existing database.','2012-07-10 21:37:33',NULL),('402832a538dd55100138dd6c37400008','Relational Database Service','Amazon Web Services (AWS)','http://aws.amazon.com/rds/','foo','2012-07-31 16:24:12',NULL);
