INSERT INTO `Project` VALUES ('2ec339c01d7e4bd0a4b7bc21192a29e0','Cloud Data Migration Tool','The Cloud Data Migration Tool (CDM) allows for migrating the data layer of an application to a cloud data store. The application itself is a Java Web application which uses a local MySQL database as data layer. The migration of the whole application to the Cloud should allow to use a compatible data store in the cloud.','IAAS','http://www.iaas.uni-stuttgart.de/','ff2c28ae2f6147f88b4471d102129077','25f8a91dcdac4f0fa7f703e3bf787254','2012-07-10 21:36:24','2012-07-31 10:43:58'),('402832a538dc15f90138dc15f9240000','Cloud Data Migration Tool 2','my super duper project','IAAS 2','http://www.iaas.uni-stuttgart.de/2','ff2c28ae2f6147f88b4471d102129077','25f8a91dcdac4f0fa7f703e3bf787254','2012-07-31 10:10:23','2012-07-31 16:29:16');
